import React from "react";
import styles from "./SavedBooks.module.css";

const SavedBooks = () => {
  const length = 1;
  return (
    <div>
      <div class="saved-books-section">
        <h1 className={styles.heading}>Saved Books</h1>
        <div class="book-counter">
          {length > 0 ? (
            <p>You have {length} books in your reading list</p>
          ) : (
            <p>No books found. Add some books to get started!</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default SavedBooks;
